import React, { Component } from 'react';


export class Rabattrechner extends Component {
    constructor(props) {
      super(props);
      this.state = {
          A: 0,
          B: 0,
          output: 330
        };

      this.handleChangeA = this.handleChangeA.bind(this);
      this.handleChangeB = this.handleChangeB.bind(this);
      this.rabattrechner = this.rabattrechner.bind(this);
    }

    handleChangeA(event) {

      this.setState({A: Number( event.target.value)});
    }
    handleChangeB(event) {

      this.setState({B: Number( event.target.value)});
    }

    rabattrechner(){
      this.setState({output: Number( this.A + this.B)});

    }

    render() {
      return (
        <div onSubmit={this.handleSubmit}>
          <label>
            Name:
            A:<input type="number" value={this.state.A} onChange={this.handleChangeA} />
            B:<input type="number" value={this.state.B} onChange={this.handleChangeB} />
          </label>
        <button onClick={this.rabattrechner}>Run</button>
        <div>
        Output:{this.output}aa
        </div>
        </div>
      );
    }
  }
  export default Rabattrechner;
